		<p onClick={() => onRouteChange('portfolio')} className='f3 link dim black underline pa3 pointer'>Portfolio</p>
		<p onClick={() => onRouteChange('contact')} className='f3 link dim black underline pa3 pointer'>Contact Me</p>

		</nav>
    )
}
